import React from 'react';
import styles from '../styles/Item.module.css';

function Item({ block, categoryId, setSelectedBlock }) {
  return (
    <button
      className={styles.item}
      onClick={() => setSelectedBlock({ ...block, categoryId })}
    >
      {block.id + 1}
    </button>
  );
}

export default Item;
